// src/components/Details/SbuLevel.js

import React, { useState, useEffect } from 'react'
import axios from 'axios'
import { Container, Table, Alert, Spinner } from 'react-bootstrap'
import { useLocation, useNavigate } from 'react-router-dom'
import Breadcrumbs from '../Breadcrumbs'

// import your currency settings
import commonData from '../../data/commonData.json'

const SbuLevel = () => {
  const navigate = useNavigate()
  const { month, year } = useLocation().state || {}

  const [data, setData] = useState([])
  const [loading, setLoading] = useState(true)
  const [error, setError] = useState('')

  // set up your formatter
  const formatter = new Intl.NumberFormat(
    commonData.currencySettings.locale,
    {
      style: 'currency',
      currency: commonData.currencySettings.currency,
      minimumFractionDigits:
        commonData.currencySettings.minimumFractionDigits,
      maximumFractionDigits:
        commonData.currencySettings.maximumFractionDigits,
    }
  )

  // helper to parse “e7” → 10^7 and format any number
  const formatValue = (val) => {
    // handle exponent-only strings like "e7"
    if (typeof val === 'string') {
      const m = val.match(/^e(\d+)$/i)
      if (m) {
        val = Math.pow(10, Number(m[1]))
      } else if (!isNaN(val)) {
        val = Number(val)
      }
    }
    // if it's a number, format as currency
    if (typeof val === 'number' && !isNaN(val)) {
      return formatter.format(val)
    }
    return val  // fallback for any other type
  }

  // derive month name in lower case
  const getMonthName = (m) =>
    new Date(year, m - 1)
      .toLocaleString('en-US', { month: 'long' })
      .toLowerCase()

  useEffect(() => {
    if (!month || !year) {
      setError(
        'Month and year are missing. Go back and select a period.'
      )
      setLoading(false)
      return
    }

    const fetchData = async () => {
      setLoading(true)
      setError('')
      try {
        const payload = {
          month: Number(month),
          year: Number(year),
          monthNameParam: getMonthName(month),
        }
        const resp = await axios.post(
          'http://localhost:8081/api/sbu',
          payload
        )
        setData(resp.data)
      } catch (err) {
        setError(err.response?.data || err.message)
      } finally {
        setLoading(false)
      }
    }
    fetchData()
  }, [month, year])

  // only keep columns except “revenue” or “sburevenue”
  const columns =
    data.length > 0
      ? Object.keys(data[0]).filter((c) => {
          const lc = c.toLowerCase()
          return lc !== 'revenue' && lc !== 'sburevenue'
        })
      : []

  return (
    <Container className="my-4">
      <Breadcrumbs path={[{ name: 'SBU Level', page: 'sbu' }]} />
      <button
        onClick={() => navigate(-1)}
        className="btn btn-link text-start mb-4 p-0"
      >
        ← Back
      </button>

      <h2>
        SBU Revenue Summary for {getMonthName(month)} {year}
      </h2>

      {loading && (
        <div className="d-flex justify-content-center my-5">
          <Spinner animation="border" role="status" className="me-2">
            <span className="visually-hidden">Loading...</span>
          </Spinner>
          Loading data...
        </div>
      )}

      {!loading && error && (
        <Alert variant="danger">{error}</Alert>
      )}

      {!loading && !error && data.length === 0 && (
        <Alert variant="info">No data found.</Alert>
      )}

      {!loading && !error && data.length > 0 && (
        <Table striped bordered hover responsive>
          <thead>
            <tr>
              {columns.map((col) => (
                <th key={col}>{col}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {data.map((row, i) => (
              <tr key={i}>
                {columns.map((col, j) => (
                  <td key={j}>{formatValue(row[col])}</td>
                ))}
              </tr>
            ))}
          </tbody>
        </Table>
      )}
    </Container>
  )
}

export default SbuLevel
